import React,{useState,useEffect} from 'react';
import axios from 'axios';


const Awards=()=>{
    const [award, setAward]=useState([]);
    useEffect(()=>{
        const response=async()=>{
            const {data}=await axios.get("http://127.0.0.1:8000/api/awards/")
            // console.log(data);
            setAward(data);
        };
        response();

    },[])
    console.log(award)
    return (
        <p>rin</p>
    )
};
export default Awards;
